import React, { Component } from 'react';
import './css/simulation.css'


class App extends Component {

    constructor() {
        super();
        var simModel = new window.simcapi.CapiAdapter.CapiModel({
            demoMode: true,
            studentResponse: '5',
            simEnabled: true
        });

    }


    render() {
    return (
      <div className="App">
          <head>
              <title>Wildlife Refuge</title>
          </head>

          <body>
          <ul>
              <li className="dropdown1">
                  <a href="javascript:void(0)" className="dropbtn1">Add Trees</a>
                  <div className="dropdown-content1">
                      <a onClick={this.simModel} href="#">Western Red Cedar</a>
                  </div>
              </li>
              <li className="dropdown2">
                  <a href="javascript:void(1)" className="dropbtn2">Add Predators </a>
                  <div className="dropdown-content2">
                      <a href="#">Red Tailed Hawk</a>
                  </div>
              </li>
              <li className="dropdown3">
                  <a href="javascript:void(2)" className="dropbtn3">Add Prey</a>
                  <div className="dropdown-content3">
                      <a href="#">Snowshoe Hare</a>
                  </div>
              </li>
              <li className="dropdown4">
                  <a href="javascript:void(2)" className="dropbtn4">Add Bushes</a>
                  <div className="dropdown-content4">
                      <a href="#">Big Sagebrush</a>
                  </div>
              </li>
          </ul>
          </body>
      </div>
    );
  }
}

export default App;
